// BlogPostListComponent.js
import React from 'react';
import './BlogPostListComponent.css';

const BlogPostListComponent = () => {
  return (
    <div className="blog-post-list">
      <h2>Blog Posts</h2>
      <ul>
        <li>Blog Post 1</li>
        <li>Blog Post 2</li>
        <li>Blog Post 3</li>
      </ul>
    </div>
  );
};

export default BlogPostListComponent;
